import { Component } from "react";
import Logo from "./Logo";
import Carro from "./Carro";
const styles = {
    navbar: {
        color: '#3e2623',
        marginBottom:'30px',
    }
}

class Navbar extends Component{
    render() {
        return (
        <nav style={styles.navbar}>
                <Logo></Logo>
                <Carro></Carro>
        </nav>  
        )
    }
}
export default Navbar
